import gmailLogo from './../images/gmail.png'
import githubLogo from './../images/github.svg'
import facebookLogo from './../images/facebook-logo.jpg'
import pluralsightLogo from './../images/pluralsight.png'


export const bannerState = {
	"authorName": 'Toan Nguyen',
	"logos": [
		{
			"name": 'GitHub',
			"href": 'https://github.com/toannguyen5699',
			"src": githubLogo
		},
		{
			"name": 'Gmail',
			"href": 'mailto: toan050699@gmail.com',
			"src": gmailLogo
		},
		{
			"name": 'Facebook',
			"href": 'https://www.facebook.com/profile.php?id=100008444040671',
			"src": facebookLogo
		},
	]
};
